import axinos from 'axios';

const url = 'https://covid19.mathdro.id/api'


export const fetchData = async () => {
    const response = await axinos.get(url);
    // console.log(response);
    const confirmed = response.data.confirmed.value;
    const recovered = response.data.recovered.value;
    const deaths = response.data.deaths.value;
    const lastUpdate = response.data.lastUpdate;
    const modified_response = {
        'confirmed': confirmed,
        'recovered': recovered,
        'deaths': deaths,
        'lastUpdate': lastUpdate 
    };

    return modified_response;
}

export const fetchDailyData = async () =>{
    const response = await axinos.get(url + '/daily');
    // console.log(response.data);
    const totalConfirmed = response.data.map((index)=>(
        // {confirmed : index.totalConfirmed}
        [index.totalConfirmed]
    ));
    // console.log(totalConfirmed);



};
